import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

import './About.scss';

const abouts = [
  { title: 'Engineer', description: 'I am a good engineer.', imgUrl: '' },
  { title: 'Designer', description: 'I am a good designer.', imgUrl: '' },
  { title: 'Programmer', description: 'I am a good programmer.', imgUrl: '' },
  { title: 'Web Developer', description: 'I am a good web developer.', imgUrl: '' }
]

const About = () => {
  return (
    <>
      <h2 className="head-text">I Know That <span>Good Design</span> means <span>Good Business</span></h2>
      <div className='app__profiles'>
        {abouts.map((about, index) => (
          <motion.div whileInView={{ opacity:1 }} whileHover={{ scale: 1.1 }} transition={{ duration: 0.5, type: 'tween' }} className="app__profile-item" key={about.title + index}>
            <img src={about.imgUrl} alt={about.title} />
            <h2 className="bold-text" style={{ marginTop: 20 }}>{about.title}</h2>

          </motion.div>
        ))}
      </div>

    </>
  )
}

export default About
